INSERT INTO `aboutus` (`aboutus_id`, `aboutus_content`, `aboutus_img`, `aboutus_status`) VALUES
(1, 'SupplyOrigin is the only digital platform dedicated to serve and resolve the challenges of SMEs in the Eastern part of the country. Our research team works relentlessly in identifying the challenges related to sourcing for SMEs and sets up robust channels & processes to plug these gaps. We play an important role in sourcing quality raw materials and finished products from trusted sources at the most economical price points. We eliminate intermediaries which brings down the costs. SMEs get the advantage of hassle-free sourcing, best pricing, quality product and freedom from transportation woes. ', 'http://192.168.88.229/supplyorigin/storage/SLIDER_IMAGE/2019/05/23/65a58df39775d410ad8456a089045007.jpg', 1);
