(1, 'New Blog', 'New Blog', '<p>Plenty of people who have heard the term blogging fail to \r\nunderstand what a blog is or how creating or reading one can impact or\r\n improve their lives. Whether you have absolutely no idea what these \r\nterms mean or you know the basics but want to learn more, this guide \r\nprovides you with a thorough breakdown of the topic.</p><p>The following sections also provide details about <a href=\"https://makeawebsitehub.com/choose-right-blogging-platform/\">popular blogging sites</a> and how to use one or more blogs to generate funds for personal and business goals.</p><h3>So exactly<em>what is a blog</em>?</h3><p>A\r\n blog is an online diary or journal located on a website. The content of\r\n a blog typically includes text, pictures, videos, animated GIFs and \r\neven scans from old physical offline diaries or journals and other hard \r\ncopy documents. Since a blog can exist merely for personal use, sharing \r\ninformation with an exclusive group or to engage the public, a blog \r\nowner can set their blog for private or public access.</p><p><span class=\"text-danger\"></span></p>', 'storage/WEBSITE_FILES/2019/06/11/56f8cf91e7bd94080e98a6fa60299266.png', 1, NULL, '2019-06-11 12:45:47', 1, '0000-00-00 00:00:00', NULL, 1);
